l=A.og("assets/images/collage.jpg",a4,"Ever heard of the phrase: \u201cClimb your own ladder\u201d? It says you should rise through your career, not by taking the easy road but by working your way up from the bottom. Taking a degree in Turkey gives you that opportunity. Good education is not for sale, and it is for those who are willing to put in effort and determination. So, if you are one of those who want to build their ladder to success, have a look at the positive impacts of traveling on students with these 18 fantastic reasons to study in Turkey.","Reasons Why You Should Study In Turkey",a4,!0)
j=A.og(a4,a4,"Turkey has a well-established and comprehensive higher education system. Across more than 180 universities have 600,000+ international students in Turkey (as of the last academic year). Turkish universities offer more than 20,000 English-taught degree programs.Many universities in Turkey are ranked among the best in the world, and many scholarships are available for international students wishing to study in Turkey.","World-Class Education System",a4,!1)
i=A.og("assets/images/image2.webp",a4,"Turkey is a multicultural and multi-ethnic country, which makes it an ideal destination for international students seeking an enriching experience abroad. Turkish people are friendly and welcoming towards foreigners, meaning you will feel at home quickly in this beautiful country. The fact that many students from all over the world choose to study at Turkish universities also means that you can easily meet new friends from all corners of the globe during your time abroad.","Multicultural Environment",a4,!0)
h=A.og(a4,a4,"The cost of living in Turkey is relatively low compared to other European countries, so you can make your money go further while enjoying a high quality of life while studying abroad. If you want to take advantage of all that Turkey offers but don\u2019t want to break the bank, studying in Turkey is a great choice!","High Quality Of Life",a4,!1)
g=A.og(a4,"assets/images/convo.jpeg","Many top-ranked Turkish universities offer high-quality education in an international environment with affordable tuition fees and living costs. These include Istanbul Technical University (ITU), Bogazici University, Sabanci University, Middle East Technical University (METU), Bilkent University, and Yildiz Technical University (YTU).","Study At A Top-Ranked Turkey University \u2013 University In Turkey ",!0,!1)
f=A.og(a4,a4,"English language proficiency is fundamental to studying abroad, as only 32% of students who cannot speak English are satisfied with their academic experience compared to 83% of students who are proficient in English (2). Many courses study in Turkey in English at both undergraduate and postgraduate levels. This means it is an excellent destination for international students who may not be proficient in Turkish or want to learn it.","English As A Medium Of Instruction",a4,!1)
e=A.og(a4,a4,"Unlike the US or UK, most of the universities in Turkey do not require language exam results like IELTS or TOEFL from their international students before accepting their applications. However, it is recommended that you should have at least intermediate English knowledge since during the application process.","Ielts Or Toefl Exams Are Not Required For The Admission Process",!0,!1)
d=A.og(a4,a4,"Living in Turkey is very cheap, especially if you compare the price to other European countries and the United States. The cost of living is one of the most important factors when choosing a study abroad destination, and Turkey can be a perfect option if you want to save money.","Living Expenses Are Low",a4,!1)
